description:
Luisa Llorente, an expert on taxation of old buildings, which had moved to the mysterious Victorian mansion Valdemar to conduct an inventory of property ownership, has disappeared. Maximilian, president of the company he works for Louisa, engages the services of Nicholas Tramel detective to find her. But it is not the first disappearance!  
